	package break_out;

import break_out.controller.Controller;
import break_out.view.View;

/**
 * The entry point of the program. The game get started here and all components
 * are initialized here.
 * 
 * @author dmlux, modified by I. Schumacher, Magnus Bender, Max Lorenz
 * 
 */
public class Main {

	/**
	 * Den Pfad zu den JSONDateien mit Levelinformationen verwalten
	 */
	private static String path = System.getProperty("user.home") + "/.breakout";


	/**
	 * The main method
	 * 
	 * @param args The arguments that were passed by the command line.
	 */
	public static void main(String[] args) {
		//einen anderen Pfad nutzen
		//	wenn per Terminal gewuenscht
		if( args.length > 0){
			Main.path = args[0];
			Main.path += "/breakoutdata";
		}

		//versuche im Programm-Order die Dateien
		//	des Spiels abzulegen bzw. pruefe Existenz des
		//	Ordners
		//		noch keine Fehler
		String error = "";
		try{
			//versuche mit Ordner
			new MakeHome( path );

		} catch( Exception e ){
			//doch ein Fehler
			error = e.getMessage();
		}

		// Create the view
		View view = new View();
		// Create the controller and pass the view object to it
		new Controller(view);

		//Wenn Programm-Order nicht erstellt werden konnte, zeige Fehler
		if( error != "" ){
			view.getStartScreen().showError( error );
		}
	}

	/**
	 * Den Pfad zu den JSONDateien fuer die Levelinformationen holen
	 * @return Pfad (ohne / am Ende)
	 */
	public static String getPath(){
		return Main.path;
	}
}
